import lists from '../../images/svg/nav/lists.svg'
import profile from '../../images/svg/nav/profile.svg'
import more from '../../images/svg/nav/more.svg'

type Title = {
  title: string,
  icon: any,
  isFlag: boolean
}

const dataNav: Array<Title> = [
